# Landa, Republic of Dagestan

}}
Landa () is a rural locality (a selo) and the administrative center of Shidibsky Selsoviet, Tlyaratinsky District, Republic of Dagestan, Russia. Population:  There are 4 streets.
Geography
Landa is located 20&nbsp;km northwest of Tlyarata (the district's administrative centre) by road. Khintida is the nearest rural locality.
